import React, { useState, useEffect } from 'react';


const FeedbackDetailsPage = ({ id }) => {
  const [feedback, setFeedback] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchFeedback = async () => {
      try {
        const fetchedFeedback = await fetchFeedbackFromDatabase(id);
        setFeedback(fetchedFeedback);
      } catch (error) {
        console.error('Error fetching feedback details:', error);
        setError('Failed to fetch feedback details.');
      } finally {
        setLoading(false);
      }
    };

    const fetchRatings = async () => {
      try {
        const fetchedRatings = await fetchRatingsFromDatabase(id);
        if (feedback) {
          setFeedback((prevFeedback) => ({
            ...prevFeedback,
            ratings: fetchedRatings,
          }));
        }
      } catch (error) {
        console.error('Error fetching ratings details:', error);
        setError('Failed to fetch ratings details.');
      }
    };

    fetchFeedback();
    fetchRatings();
  }, [id]);

  // Function to fetch feedback from the database
  const fetchFeedbackFromDatabase = async (feedbackId) => {
    const feedbackData = await FeedbackModel.findById(feedbackId).exec();
    if (!feedbackData) {
      throw new Error('Feedback not found');
    }
    return feedbackData;
  };

  // Function to fetch ratings from the database
  const fetchRatingsFromDatabase = async (feedbackId) => {
    const ratingsData = await RatingsModel.findOne({ feedbackId }).exec();
    if (!ratingsData) {
      throw new Error('Ratings not found');
    }
    return ratingsData;
  };

  if (loading) return <div>Loading...</div>;
  if (error) return <div>{error}</div>;
  if (!feedback) return <div>No feedback found</div>;

  return (
    <div>
      <h1>Feedback Details</h1>
      <table>
        <tbody>
          <tr>
            <td>Institution Name:</td>
            <td>{feedback.institutionName}</td>
          </tr>
          <tr>
            <td>Website:</td>
            <td>{feedback.website}</td>
          </tr>
          <tr>
            <td>Visit Date:</td>
            <td>{new Date(feedback.visitDate).toLocaleDateString()}</td>
          </tr>
          <tr>
            <td>Staff Name:</td>
            <td>{feedback.staffName}</td>
          </tr>
          <tr>
            <td>Staff Email:</td>
            <td>{feedback.staffEmail}</td>
          </tr>
          <tr>
            <td>Staff Mobile:</td>
            <td>{feedback.staffMobile}</td>
          </tr>
          <tr>
            <td>Total Students:</td>
            <td>{feedback.totalStudents}</td>
          </tr>
          <tr>
            <td>Accompanying Staff:</td>
            <td>{feedback.accompanyingStaff}</td>
          </tr>
        </tbody>
      </table>

      <h2>Ratings</h2>
      <table>
        <tbody>
          <tr>
            <td>IPR Rating:</td>
            <td>{feedback.ratings ? feedback.ratings.iprRating : 'N/A'}</td>
          </tr>
          <tr>
            <td>FCIPT Rating:</td>
            <td>{feedback.ratings ? feedback.ratings.fciptRating : 'N/A'}</td>
          </tr>
          <tr>
            <td>Knowledge:</td>
            <td>{feedback.ratings ? feedback.ratings.knowledge : 'N/A'}</td>
          </tr>
          <tr>
            <td>Explanations IPR:</td>
            <td>{feedback.ratings ? feedback.ratings.explanationsIPR : 'N/A'}</td>
          </tr>
          <tr>
            <td>Explanations FCIPT:</td>
            <td>{feedback.ratings ? feedback.ratings.explanationsFCIPT : 'N/A'}</td>
          </tr>
          <tr>
            <td>Knowledge Before:</td>
            <td>{feedback.ratings ? feedback.ratings.knowledgeBefore : 'N/A'}</td>
          </tr>
          <tr>
            <td>Knowledge After:</td>
            <td>{feedback.ratings ? feedback.ratings.knowledgeAfter : 'N/A'}</td>
          </tr>
          <tr>
            <td>Technical Contents:</td>
            <td>{feedback.ratings ? feedback.ratings.technicalContents : 'N/A'}</td>
          </tr>
          <tr>
            <td>Ease of Understanding:</td>
            <td>{feedback.ratings ? feedback.ratings.easeOfUnderstanding : 'N/A'}</td>
          </tr>
        </tbody>
      </table>

      <h2>Additional Information</h2>
      <p>Sources: {feedback.sources.join(', ')}</p>
      <p>Campuses: {feedback.campuses.join(', ')}</p>
      <p>Best: {feedback.best}</p>
      <p>Worst: {feedback.worst}</p>
      <p>Suggestions: {feedback.suggestions}</p>
      <p>Comments: {feedback.comments}</p>

      <p>Created At: {new Date(feedback.createdAt).toLocaleString()}</p>
      <p>Updated At: {new Date(feedback.updatedAt).toLocaleString()}</p>
    </div>
  );
};

export default FeedbackDetailsPage;
